// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./IERC721.sol";
import "./IERC721Receiver.sol";
import "./Address.sol";
import "./Context.sol";
import "./ERC165.sol";
import "./main.sol";

/**
 * @dev Implementation of https://eips.ethereum.org/EIPS/eip-721[ERC721] Non-Fungible Token Standard, including
 * the Metadata extension, but not including the Enumerable extension, which is available separately as
 * {ERC721Enumerable}.
 */
contract TheInfinityCollections is Context, ERC165, IERC721, EternalHouseFactory {


    using Address for address;
    using Strings for uint256;
    using SafeMath for uint256;

    // Mapping from token ID to owner address
    mapping(uint256 => address) private _owners;

    // Mapping owner address to token count
    mapping(address => uint256) private _balances;

    // Mapping from token ID to approved address
    mapping(uint256 => address) private _tokenApprovals;

    // Mapping from owner to operator approvals
    mapping(address => mapping(address => bool)) private _operatorApprovals;


     struct slot{
        string name;
        string description;
        string imgUrl;
        uint256 id; 
        uint256 size; // 0 - xs , 1 - s, 2 - m, 3 - l, 4-xl, 5 -ul ..
        uint256 changed;
        uint256 lastUpdated;
    }


    slot[1090] slots; // array of slots in house
    slot[] minted; // minted slots so far



    // allotment for sizes
    // [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeAllotment = [160,200,300,200,100,100,28,2];

    // num slots already created
    // [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeCreated = [0,0,0,0,0,0,0,0];

    // fees to mint each slot 
    // [0] = xs, [1] = s, [2] = m, [3] = l, [4] = xl, [5] == xxl, [6] == ultra, [7] == king
    uint256[] sizeFees = [.0001 ether, .0001 ether, .0001 ether, .0001 ether, .0001 ether, .0001 ether, .0001 ether,.0001 ether];

    mapping(uint256 => string) public tokenURIs; // ids to tokenURIs


    ///////////////////////////////

    /// EVENTS  ///

    /////////////////////////////
    event NewSlot(uint256 id,string name, string description,string imgUrl, uint256 size,string tokenURI);
    event UpdatedSlot(uint256 id,string name, string description,string imgUrl,string tokenURI);
    event UpdatedBaseURI(string baseURI);

    ///////////////////////////////

        /// MODIFIERS  ///

    /////////////////////////////
     // require that address is owner of the slot
    modifier canMint(uint256 _size) {
            require(sizeCreated[_size] < sizeAllotment[_size], "All slots for that this size been minted");
    _;
  }



    /**
     * @dev See {IERC165-supportsInterface}.
     */
    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return
            interfaceId == type(IERC721).interfaceId ||
            super.supportsInterface(interfaceId);
    }

    /**
     * @dev See {IERC721-balanceOf}.
     */
    function balanceOf(address owner) public view virtual override returns (uint256) {
        require(owner != address(0), "ERC721: balance query for the zero address");
        return _balances[owner];
    }

    /**
     * @dev See {IERC721-ownerOf}.
     */
    function ownerOf(uint256 tokenId) public view virtual override returns (address) {
        address owner = _owners[tokenId];
        require(owner != address(0), "ERC721: owner query for nonexistent token");
        return owner;
    }


    /**
     * @dev See {IERC721Metadata-tokenURI}.
     */
    function tokenURI(uint256 tokenId) public view virtual  returns (string memory) {
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        return tokenURIs[tokenId];
    }


    //  only the owner can set the baseURI for tokenURI
    function setTokenURI(uint256 tokenId, string memory _tokenURI) external onlyOwner() returns(string memory){
        require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");
        tokenURIs[tokenId] = _tokenURI;
        emit UpdatedBaseURI(tokenURIs[tokenId]);
    }

      //  only the owner can set the baseURI for tokenURI
    function _setTokenURI(uint256 tokenId, string memory _tokenURI) internal returns(string memory){
        tokenURIs[tokenId] = _tokenURI;
    }


    /**
     * @dev See {IERC721-approve}.
     */
    function approve(address to, uint256 tokenId) public virtual override {
        address owner = TheInfinityCollections.ownerOf(tokenId);
        require(to != owner, "ERC721: approval to current owner");

        require(
            _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not owner nor approved for all"
        );

        _approve(to, tokenId);
    }

    /**
     * @dev See {IERC721-getApproved}.
     */
    function getApproved(uint256 tokenId) public view virtual override returns (address) {
        require(_exists(tokenId), "ERC721: approved query for nonexistent token");

        return _tokenApprovals[tokenId];
    }

    /**
     * @dev See {IERC721-setApprovalForAll}.
     */
    function setApprovalForAll(address operator, bool approved) public virtual override {
        _setApprovalForAll(_msgSender(), operator, approved);
    }

    /**
     * @dev See {IERC721-isApprovedForAll}.
     */
    function isApprovedForAll(address owner, address operator) public view virtual override returns (bool) {
        return _operatorApprovals[owner][operator];
    }

    /**
     * @dev See {IERC721-transferFrom}.
     */
    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        //solhint-disable-next-line max-line-length
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");

        _transfer(from, to, tokenId);
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        safeTransferFrom(from, to, tokenId, "");
    }

    /**
     * @dev See {IERC721-safeTransferFrom}.
     */
    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(_isApprovedOrOwner(_msgSender(), tokenId), "ERC721: transfer caller is not owner nor approved");
        _safeTransfer(from, to, tokenId, _data);
    }

    /**
     * @dev Safely transfers `tokenId` token from `from` to `to`, checking first that contract recipients
     * are aware of the ERC721 protocol to prevent tokens from being forever locked.
     *
     * `_data` is additional data, it has no specified format and it is sent in call to `to`.
     *
     * This internal function is equivalent to {safeTransferFrom}, and can be used to e.g.
     * implement alternative mechanisms to perform token transfer, such as signature-based.
     *
     * Requirements:
     *
     * - `from` cannot be the zero address.
     * - `to` cannot be the zero address.
     * - `tokenId` token must exist and be owned by `from`.
     * - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
    function _safeTransfer(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) internal virtual {
        _transfer(from, to, tokenId);
        require(_checkOnERC721Received(from, to, tokenId, _data), "ERC721: transfer to non ERC721Receiver implementer");
    }

    /**
     * @dev Returns whether `tokenId` exists.
     *
     * Tokens can be managed by their owner or approved accounts via {approve} or {setApprovalForAll}.
     *
     * Tokens start existing when they are minted (`_mint`),
     * and stop existing when they are burned (`_burn`).
     */
    function _exists(uint256 tokenId) internal view virtual returns (bool) {
        return _owners[tokenId] != address(0);
    }

    /**
     * @dev Returns whether `spender` is allowed to manage `tokenId`.
     *
     * Requirements:
     *
     * - `tokenId` must exist.
     */
    function _isApprovedOrOwner(address spender, uint256 tokenId) internal view virtual returns (bool) {
        require(_exists(tokenId), "ERC721: operator query for nonexistent token");
        address owner = TheInfinityCollections.ownerOf(tokenId);
        return (spender == owner || getApproved(tokenId) == spender || isApprovedForAll(owner, spender));
    }

    /**
     * @dev Safely mints `tokenId` and transfers it to `to`.
     *
     * Requirements:
     *
     * - `tokenId` must not exist.
     * - If `to` refers to a smart contract, it must implement {IERC721Receiver-onERC721Received}, which is called upon a safe transfer.
     *
     * Emits a {Transfer} event.
     */
    function _safeMint(address to, uint256 tokenId) internal virtual {
        _safeMint(to, tokenId, "");
    }

    /**
     * @dev Same as {xref-ERC721-_safeMint-address-uint256-}[`_safeMint`], with an additional `data` parameter which is
     * forwarded in {IERC721Receiver-onERC721Received} to contract recipients.
     */
    function _safeMint(
        address to,
        uint256 tokenId,
        bytes memory _data
    ) internal virtual {
        _mint(to, tokenId);
        require(
            _checkOnERC721Received(address(0), to, tokenId, _data),
            "ERC721: transfer to non ERC721Receiver implementer"
        );
    }

    /**
     * @dev Mints `tokenId` and transfers it to `to`.
     *
     * WARNING: Usage of this method is discouraged, use {_safeMint} whenever possible
     *
     * Requirements:
     *
     * - `tokenId` must not exist.
     * - `to` cannot be the zero address.
     *
     * Emits a {Transfer} event.
     */
    function _mint(address to, uint256 tokenId) internal virtual {
        require(to != address(0), "ERC721: mint to the zero address");
        require(!_exists(tokenId), "ERC721: token already minted");

        _beforeTokenTransfer(address(0), to, tokenId);

        _balances[to] += 1;
        _owners[tokenId] = to;

        emit Transfer(address(0), to, tokenId);
    }


    /**
     * @dev Transfers `tokenId` from `from` to `to`.
     *  As opposed to {transferFrom}, this imposes no restrictions on msg.sender.
     *
     * Requirements:
     *
     * - `to` cannot be the zero address.
     * - `tokenId` token must be owned by `from`.
     *
     * Emits a {Transfer} event.
     */
    function _transfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {
        require(TheInfinityCollections.ownerOf(tokenId) == from, "ERC721: transfer of token that is not own");
        require(to != address(0), "ERC721: transfer to the zero address");
        require(_isReady() == true, "Hibernation Period In Effect");
        _beforeTokenTransfer(from, to, tokenId);

        // Clear approvals from the previous owner
        _approve(address(0), tokenId);

        _balances[from] -= 1;
        _balances[to] += 1;
        _owners[tokenId] = to;

        slot storage mySlot = slots[tokenId];
        _restoreSlotChanged(mySlot); // restore some details of slot

        emit Transfer(from, to, tokenId);
    }

    /**
     * @dev Approve `to` to operate on `tokenId`
     *
     * Emits a {Approval} event.
     */
    function _approve(address to, uint256 tokenId) internal virtual {
        _tokenApprovals[tokenId] = to;
        emit Approval(TheInfinityCollections.ownerOf(tokenId), to, tokenId);
    }

    /**
     * @dev Approve `operator` to operate on all of `owner` tokens
     *
     * Emits a {ApprovalForAll} event.
     */
    function _setApprovalForAll(
        address owner,
        address operator,
        bool approved
    ) internal virtual {
        require(owner != operator, "ERC721: approve to caller");
        _operatorApprovals[owner][operator] = approved;
        emit ApprovalForAll(owner, operator, approved);
    }

    /**
     * @dev Internal function to invoke {IERC721Receiver-onERC721Received} on a target address.
     * The call is not executed if the target address is not a contract.
     *
     * @param from address representing the previous owner of the given token ID
     * @param to target address that will receive the tokens
     * @param tokenId uint256 ID of the token to be transferred
     * @param _data bytes optional data to send along with the call
     * @return bool whether the call correctly returned the expected magic value
     */
    function _checkOnERC721Received(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) private returns (bool) {
        if (to.isContract()) {
            try IERC721Receiver(to).onERC721Received(_msgSender(), from, tokenId, _data) returns (bytes4 retval) {
                return retval == IERC721Receiver.onERC721Received.selector;
            } catch (bytes memory reason) {
                if (reason.length == 0) {
                    revert("ERC721: transfer to non ERC721Receiver implementer");
                } else {
                    assembly {
                        revert(add(32, reason), mload(reason))
                    }
                }
            }
        } else {
            return true;
        }
    }

    /**
     * @dev Hook that is called before any token transfer. This includes minting
     * and burning.
     *
     * Calling conditions:
     *
     * - When `from` and `to` are both non-zero, ``from``'s `tokenId` will be
     * transferred to `to`.
     * - When `from` is zero, `tokenId` will be minted for `to`.
     * - When `to` is zero, ``from``'s `tokenId` will be burned.
     * - `from` and `to` are never both zero.
     *
     * To learn more about hooks, head to xref:ROOT:extending-contracts.adoc#using-hooks[Using Hooks].
     */
    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal virtual {}





    /// @return an id for the slot
    function _createID(uint256 _size) internal view returns(uint256){
        if(_size == 0){ // xs
            return sizeCreated[0];
        } 
        uint256 _id = 0;
        for(uint256 i = 0; i < _size; i++){
            _id = _id.add(sizeAllotment[i]);
        }
        _id = _id.add(sizeCreated[_size]);
        return _id;

    }

     /// @dev update the number of slots created for a given size
    function _updateCreationCount(uint256 _size) internal{
        sizeCreated[_size] = sizeCreated[_size].add(1);

    }

    /// @dev makes sure there was enough ether sent to contract for the sizes that need to be minted
    /// @param _sizeArr - array containing all of the descriptions of slots to mint
    /// @return boolean -- was there enough ether? 
    function _enoughEther(uint256[] memory _sizeArr) internal returns(bool){
        uint256 needed = 0 ether;
        for(uint256 i = 0; i < _sizeArr.length; i++){
            needed = needed.add(sizeFees[_sizeArr[i]]);
        }
        return msg.value >= needed;
    }

    /* 
        Slots are created based on array indexes 
        _descriptionArr[0], _imgUrlArr[0], _sizeArr[0] maps to one slot
        _descriptionArr[1], _imgUrlArr[1], _sizeArr[1] maps to another slot... and so on
        Check if enough ether to mint all slots. Arrays must be same length. Can't mint more than 20 at time
    */
    /// @dev create slot(s) in one of the houses 
    /// @param _descriptionArr - array containing all of the descriptions of slots to mint
     /// @param _imgUrlArr - array containing all of the img urls of slots to mint
      /// @param _sizeArr - array containing all of the sizes of slots to mint
    function createSlot(string[] memory _namesArr, string[] memory _descriptionArr, string[] memory _imgUrlArr, uint256[] memory _sizeArr,string[] memory _URIs) public payable {
        require(_enoughEther(_sizeArr) == true,"Fee entered is not fee for the slot");
        require(_descriptionArr.length == _imgUrlArr.length, "Cannot mint. Arrays are different lengths");
        require(_imgUrlArr.length == _sizeArr.length, "Cannot mint. Arrays are different lengths");
        require(_sizeArr.length == _URIs.length, "Cannot mint. Arrays are different lengths");
        require(_URIs.length == _namesArr.length, "Cannot mint. Arrays are different lengths");
        require(_descriptionArr.length > 0 , "No data sent in");
        require(_descriptionArr.length <= 20 , "Trying to mint too much");
         for(uint256 i = 0; i < _descriptionArr.length; i++){
             string memory _name = _namesArr[i];
             string memory _description = _descriptionArr[i];
             string memory _imgUrl = _imgUrlArr[i];
             uint256 _size = _sizeArr[i];
             string memory _uri = _URIs[i];
             require(bytes(_name).length != 0, "Null name");
             require(bytes(_imgUrl).length != 0, "Null Image URL");
             require(bytes(_uri).length != 0, "Null Token URI");
             if(bytes(_description).length != 0){
                 _createSlot(_name,_description, _imgUrl, _size, _uri);
             } else{
                _createSlot(_name," ", _imgUrl, _size, _uri);
            }
        }

    }

     /// initializes a slot in the Infinity Collections
    /// @dev check if more slots can minted, 
    /// @param _description - the description of the slot 
    /// @param _imgUrl - the imgURL associated with the slot
    /// @param _size -- the slot's size 
    function _createSlot(string memory _name,string memory _description, string memory _imgUrl, uint256 _size, string memory _uri) internal canMint(_size){
        uint256 id = _createID(_size);
        slot memory purchased = slot(_name,_description, _imgUrl,id, _size,0,block.timestamp); // new slot
        slots[id] = purchased;
        _safeMint(msg.sender, id);
        _updateCreationCount(_size);
        _setTokenURI(id, _uri);
        minted.push(purchased);
        emit NewSlot(id,_name, _description, _imgUrl, _size,_uri);
    }

     /// @dev -- restore slot after transfer
    /// @param _mySlot -- slot to restore
    function _restoreSlotChanged(slot storage _mySlot) internal{ 
        _mySlot.changed = 0;
    }

     /// @dev -- given that we have decided to set hibernation / sale periods, we need to check if it's okay to make a transfer
    // start at intial freeze. then find where the hibernation period would end from this initial slot. if now is less than or equal that period, then we're in hibernation
    // if now > that period, let's find where the next sale period would end from this respective time. if now is less than or equal to that period, then we're in sale period
    // repeat these process by alternating between hibernating and sales until we discover where we're located
    /// @return bool -- true if we're not hibernating, false if we are
    function _canTransfer() internal view returns(bool){
        bool hibernating = true;
        bool notFound = true;
        uint256 interval = initialFreezeTimeStamp;
        while(notFound){
            interval = interval.add(hibernationTimePeriod);
            hibernating = true;
            if(block.timestamp <= interval){
                notFound = false;
                break;
            }
            hibernating = false;
            interval = interval.add(saleTimePeriod);
            if(block.timestamp <= interval){
                notFound = false;
                break;
            }
        }
        if(hibernating == false) return true;
        return false;
    }

    // determines if we're in hibernation or sale period
     function _isReady() internal  view returns (bool) {
         if(initialFreezeTimeStamp == 0 || hibernationTimePeriod == 0 || saleTimePeriod == 0) return true; // if any of these variables are null, we are live
         if(initialFreezeTimeStamp != 0 && block.timestamp < initialFreezeTimeStamp) return true; // if now is before intial freezing, we are live
         if(_canTransfer() == true) return true; // if we're in a sale period, then can transfer, make changes, etc
         return false; // we're in a hibernation period
  }



    /// change information associated with a slot
    function changeSlotInfo(uint256 id, string memory _name,string memory _description, string memory _imgUrl, string memory _uri) public {
        _changeSlotInfo(id, _name,_description, _imgUrl, _uri);
    }

    /// @dev -- makes sure that person hasn't edited slot more than twice
    /// @param id -- associated with slot
    /// @param _description -- slot's description to change to
    /// @param _imgUrl -- slot's new imgUrl
    function _changeSlotInfo(uint256 id, string memory _name,string memory _description, string memory _imgUrl,string memory _uri) internal{
        require(_exists(id), "ERC721Metadata: URI query for nonexistent token");
        address owner = TheInfinityCollections.ownerOf(id);
        require(
            _msgSender() == owner || isApprovedForAll(owner, _msgSender()),
            "ERC721: approve caller is not owner nor approved to make changes"
        );
        require(bytes(_name).length != 0);
        require(bytes(_imgUrl).length != 0);
        require(bytes(_uri).length != 0);
        require(_isReady() == true, "Hibernation Period In Effect");
        slot storage mySlot = slots[id]; 
        require(mySlot.changed < 2, "Reached maximum number of edits");
        if(bytes(_description).length == 0){
            mySlot.description = "";
        } else{
            mySlot.description = _description;
        }
        mySlot.imgUrl = _imgUrl;
        mySlot.lastUpdated = block.timestamp;
        mySlot.name = _name;
        _setTokenURI(id, _uri);
        mySlot.changed++;
        slots[id] = mySlot;
       _updateMintedIndex(mySlot); // replace the old minted index with this updated slot
        emit UpdatedSlot(mySlot.id, mySlot.name,mySlot.description, mySlot.imgUrl, _uri);
    }


    // replace the minted index with the updated slot. this will help us with our get slots function
    function _updateMintedIndex(slot storage _updatedSlot) internal{ 
        for(uint256 i = 0; i < minted.length; i++){
            slot storage _oldSlot = minted[i];
            if(_oldSlot.id == _updatedSlot.id){
                minted[i] = _updatedSlot;
            }
        }
    } 





      /// @dev -- get the slots that have been mitned so far. this makes it easy to access the slots while minting is taking place
    /// @return arrays and each index in an array represents a given slot. [0],[0],[0].. will represent the fields of a given slot
  function getSlots() public view returns(string[] memory,string[] memory,string[] memory,address[] memory,uint256[] memory,uint256[] memory, string[] memory) {
        string[] memory _namesArr = new string[] (minted.length);
        string[] memory _descriptionArr = new string[] (minted.length);
        string[] memory _imgUrlArr = new string[] (minted.length);
        address[] memory _addresses = new address[] (minted.length);
        uint256[] memory _idArr = new uint256[] (minted.length);
        uint256[] memory _sizeArr = new uint256[] (minted.length);
        uint256[] memory _updatedArr = new uint256[] (minted.length);
        string[] memory _tokenURIArr = new string[] (minted.length);

        for(uint256 i = 0; i < minted.length; i++){
            uint256 id = minted[i].id;
            _namesArr [i] = minted[i].name;
            _descriptionArr [i] = minted[i].description;
            _imgUrlArr[i] = minted[i].imgUrl;
            _addresses[i] = _owners[id];
            _idArr[i] = id;
            _sizeArr[i] = minted[i].size;
            _updatedArr[i] = minted[i].lastUpdated;
            _tokenURIArr[i] = tokenURI(id);
        }
        return (_namesArr,_descriptionArr,_imgUrlArr,_addresses,_idArr,_updatedArr,_tokenURIArr);
    }

    // get a slot by id. will return it's field and tokenURI
    function getSlot(uint _id) public view returns(string memory,string memory, string memory, address, uint256, uint256, string memory){
        require(_exists(_id), "ERC721Metadata: URI query for nonexistent token");
        slot memory _thisSlot = slots[_id];
        return (_thisSlot.name,_thisSlot.description,_thisSlot.imgUrl, _owners[_id],_thisSlot.id,_thisSlot.lastUpdated, tokenURI(_id));
    }





}

